  false,\n\t\"url\": null,\n\t\"notes\": \"USGS Structures from The National Map (TNM)
  consists of data to include the name, function, location, and other core information
  and characteristics of selected manmade facilities. The types of structures collected
  are largely determined by the needs of disaster planning and emergency response,
  and homeland security organizations. Structures currently being collected are: School,
  Technical/Trade School, College/University, Fire Station/EMS Station, Law Enforcement,
  Prison/Correctional Facility, State Capitol, Hospital/Medical Center, Ambulance
  Service, Cemetery, and Post Office. Structures data are designed to be used in general
  mapping and in the analysis of structure related activities using geographic information
  system technology. The National Map structures data is commonly combined with other
  data themes, such as boundaries, elevation, hydrography, and transportation, to
  produce general reference base maps. The National Map download client allows free
  downloads of public domain structures data in either Esri File Geodatabase or Shapefile
  formats. For additional information on the structures data model, go to http://nationalmap.gov/structures.html.\",\n\t\"license_title\":
